dataset.sql:
SELECT COUNT(*) as count, sum(cast(ys as int)) as ysum,sum(cast(ssys as int)) as sssum from zpda
WHERE ys not like '%[^0-9]%'
and (bgqx = '长期' or bgqx = '永久');

SELECT COUNT(*) as count, sum(cast(ys as int)) as ysum,sum(cast(_piccount as int)) as sssum from ypda
WHERE ys not like '%[^0-9]%'
and (bgqx = '长期' or bgqx = '永久' or bgqx = '定期' or bgqx = '30年');

SELECT COUNT(*) as count, sum(cast(ys as int)) as ysum,sum(cast(_piccount as int)) as sssum from spda
WHERE ys not like '%[^0-9]%'
and (bgqx = '长期' or bgqx = '永久');
